class AddCardModel {  String? pan;  String? expiredYear;  String? expiredMonth;  String? name;  AddCardModel({this.pan, this.expiredYear, this.expiredMonth, this.name});  AddCardModel.fromJson(Map<String, dynamic> json) {    pan = json['pan'];    expiredYear = json['expired-year'];    expiredMonth = json['expired-month'];    name = json['name'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data['pan'] = pan;    data['expired-year'] = expiredYear;    data['expired-month'] = expiredMonth;    data['name'] = name;    return data;  }}